import React from 'react';
//import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";
import HomePage from './routes/HomePage';

function App() {

  return(
    <Router>
      <Routes>
    <div className="App">
      <h1>PORTFOLIO</h1>
    </div>
      <Route path='/HomePage' element={<HomePage/>}/>
    </Routes>
    </Router>

  )

};
export default App;
